import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { useLanguage } from '../Store/LanguageContext';

const ADMIN_PASSWORD = "admin123";

const AdminLogin = () => {
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [loggedIn, setLoggedIn] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();
  const { lang, setLang } = useLanguage();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (password === ADMIN_PASSWORD) {
      localStorage.setItem("isAdmin", "true");
      setLoggedIn(true);
      setError("");
    } else {
      setError("Incorrect password");
    }
  };

  // مكون زر الرجوع الثابت (خارج أي نموذج)
  const GoBackButton = () => (
    <div style={{
      marginBottom: "1.5rem",
      display: "flex",
      justifyContent: "flex-start"
    }}>
      <button
        style={{
          padding: "0.75rem 1.2rem",
          borderRadius: "999px",
          background: "linear-gradient(90deg, #a67c52 0%, #e9dbc7 100%)",
          color: "#fff",
          fontWeight: 700,
          border: "none",
          boxShadow: "0 2px 5px rgba(166,124,82,0.15)",
          cursor: "pointer",
          display: "flex",
          alignItems: "center",
          gap: "0.5rem"
        }}
        onClick={() => navigate('/')}
      >
        ← {lang === 'ar' ? 'الرجوع إلى الرئيسية' : 'Back to Home'}
      </button>
    </div>
  );

  if (loggedIn) {
    return (
      <div
        style={{
          minHeight: "100vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          background: "linear-gradient(135deg, #f3e9dd 0%, #e9dbc7 35%, #f7f3e9 70%, #e2c9a7 100%)",
          fontFamily: "Tajawal, Cairo, Roboto, sans-serif",
        }}
      >
        <div
          style={{
            background: "rgba(255,255,255,0.97)",
            borderRadius: "28px",
            boxShadow: "0 8px 40px rgba(30, 64, 175, 0.10)",
            padding: "2.5rem 2rem",
            border: "2px solid #e9dbc7",
            minWidth: "320px",
            maxWidth: "400px",
            width: "100%",
            textAlign: 'center',
          }}
        >
          <GoBackButton /> {/* زر الرجوع في الأعلى خارج أي نموذج */}

          <h2 style={{ color: "#a67c52", fontWeight: 800, marginBottom: "2rem" }}>
            {lang === 'ar' ? 'مرحباً أيها الأدمن' : 'Welcome Admin'}
          </h2>
          <button
            style={{
              width: "100%",
              padding: "1rem 0",
              borderRadius: "999px",
              background: "linear-gradient(90deg, #43a047 0%, #a6d1ff 100%)",
              color: "#fff",
              fontWeight: 800,
              fontSize: "1.15rem",
              border: "none",
              boxShadow: "0 2px 8px rgba(67, 160, 71, 0.10)",
              cursor: "pointer",
              marginBottom: 18,
              marginTop: 8,
              transition: "background 0.2s, transform 0.13s",
            }}
            onClick={() => navigate('/admin/add-event')}
          >
            {lang === 'ar' ? 'إضافة فعالية' : 'Add Event'}
          </button>
          <button
            style={{
              width: "100%",
              padding: "1rem 0",
              borderRadius: "999px",
              background: "linear-gradient(90deg, #e53935 0%, #e67e22 100%)",
              color: "#fff",
              fontWeight: 800,
              fontSize: "1.15rem",
              border: "none",
              boxShadow: "0 2px 8px rgba(229,57,53,0.10)",
              cursor: "pointer",
              marginBottom: 8,
              marginTop: 8,
              transition: "background 0.2s, transform 0.13s",
            }}
            onClick={() => navigate('/admin/feedback')}
          >
            {lang === 'ar' ? 'تعديل أو حذف فعالية' : 'Edit or Delete Event'}
          </button>
        </div>
      </div>
    );
  }

  return (
    <div
      style={{
        minHeight: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "linear-gradient(135deg, #f3e9dd %, #e9dbc7 35%, #f7f3e9 70%, #e2c9a7 100%)",
        fontFamily: "Tajawal, Cairo, Roboto, sans-serif",
      }}
    >
      <div
        style={{
          background: "rgba(255,255,255,0.97)",
          borderRadius: "28px",
          boxShadow: "0 8px 40px rgba(30, 64, 175, 0.10)",
          padding: "2.5rem 2rem",
          border: "2px solid #e9dbc7",
          minWidth: "320px",
          maxWidth: "400px",
          width: "100%",
        }}
      >
        <GoBackButton /> {/* زر الرجوع في الأعلى */}

        <h2 style={{ textAlign: "center", color: "#a67c52", fontWeight: 800, marginBottom: "2rem"}}>
          Admin Login
        </h2>
        <form onSubmit={handleSubmit}>
          <input
            type="password"
            value={password}
            onChange={e => setPassword(e.target.value)}
            placeholder={lang === 'ar' ? 'أدخل كلمة المرور' : 'Enter admin password'}
            style={{
              width: "100%",
              padding: "1rem",
              borderRadius: "14px",
              border: "1.5px solid #e9dbc7",
              margin: "1rem 0 1.5rem 0",
              fontSize: "1.1rem",
              outline: "none",
              background: "#f7f3e9",
              transition: "border-color 0.2s",
            }}
            onFocus={e => e.target.style.border = '1.5px solid #a67c52'}
            onBlur={e => e.target.style.border = '1.5px solid #e9dbc7'}
            required
          />
          {error && <div style={{ color: "#c00", marginBottom: 10, textAlign: 'center' }}>{error}</div>}
          <button
            type="submit"
            style={{
              width: "100%",
              padding: "1rem 0",
              borderRadius: "999px",
              background: "linear-gradient(90deg, #a67c52 0%, #e9dbc7 100%)",
              color: "#fff",
              fontWeight: 800,
              fontSize: "1.15rem",
              border: "none",
              boxShadow: "0 2px 8px rgba(166, 124, 82, 0.10)",
              cursor: "pointer",
              transition: "background 0.2s, transform 0.13s",
            }}
            onMouseOver={e => e.currentTarget.style.background = 'linear-gradient(90deg, #e9dbc7 0%, #a67c52 100%)'}
            onMouseOut={e => e.currentTarget.style.background = 'linear-gradient(90deg, #a67c52 0%, #e9dbc7 100%)'}
          >
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default AdminLogin;
